import React, { useState, useEffect } from 'react';
import api from '../services/api';
import StoresMap from '../components/StoresMap'; // Import component bản đồ

function DashBoardPage() {
    const [stores, setStores] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        // Fetch dữ liệu cửa hàng ngay khi component được tải
        const fetchStores = async () => {
            try {
                const response = await api.get('/stores');
                setStores(response.data.data);
            } catch (err) {
                setError('Failed to load store data for the map.');
                console.error(err);
            } finally {
                setLoading(false);
            }
        };

        fetchStores();
    }, []); // Mảng rỗng đảm bảo useEffect chỉ chạy một lần
    
    const districts = [
    "An Giang", "Ba Ria Vung Tau", "Bac Giang", "Bac Lieu", "Bac Ninh",
    "Ben Tre", "Binh Dinh", "Binh Duong", "Binh Phuoc", "Binh Thuan",
    "Ca Mau", "Can Tho", "Da Nang", "Dak Lak", "Dong Nai", "Dong Thap",
    "Gia Lai", "Ha Noi", "Hai Duong", "Hai Phong", "Hau Giang", "Ho Chi Minh City",
    "Hung Yen", "Khanh Hoa", "Kien Giang", "Lam Dong", "Long An",
    "Nghe An", "Quang Nam", "Quang Ngai", "Soc Trang", "Tay Ninh",
    "Thai Binh", "Thanh Hoa", "Thua Thien Hue", "Tien Giang", "Tra Vinh",
    "Vinh Long", "Vinh Phuc"
    ];

    // Map province/city -> list of district_raw values
    const districtMap = {
        "An Giang": ["HChauPhu","TpChauDoc","TpLongXuyen"],
        "Ba Ria Vung Tau": ["HChauDuc","HDatDo","HLongDien","HXuyenMoc","TpBaRia","TpVungTau","TxPhuMy"],
        "Bac Giang": ["TpBacGiang"],
        "Bac Lieu": ["HHoaBinh","TpBacLieu"],
        "Bac Ninh": ["TpBacNinh","TxTuSon"],
        "Ben Tre": ["HBaTri","TpBenTre"],
        "Binh Dinh": ["QTPhu","TpQuyNhon"],
        "Binh Duong": ["TpThuanAn","TpThuDauMot","TxBenCat","TxDiAn"],
        "Binh Phuoc": ["TpDongXoai","TxPhuocLong"],
        "Binh Thuan": ["TpPhanThiet","TxLaGi"],
        "Ca Mau": ["HCaiNuoc","TpCaMau"],
        "Can Tho": ["HThoiLai","QBinhThuy","QCaiRang","QNinhKieu","QThotNot"],
        "Da Nang": ["HHoaVang","QCamLe","QHaiChau","QLienChieu","QNguHanhSon","QSonTra","QThanhKhe"],
        "Dak Lak": ["TpBuonMaThuot","TxBuonHo"],
        "Dong Nai": ["HLongThanh","HNhonTrach","HTrangBom","HVinhCuu","TpBienHoa","TpGoCong","TxLongKhanh"],
        "Dong Thap": ["TpCaoLanh","TpSaDec"],
        "Gia Lai": ["TpPleiku"],
        "Ha Noi": ["HDongAnh","HGiaLam","HHoaiDuc","HThanhOai","HThanhTri","QBacTuLiem","QBaDinh","QCauGiay","QDongDa","QHaDong","QHaiBaTrung","QHoangMai","QHoanKiem","QLongBien","QNamTuLiem","QTayHo","QThanhTri","QThanhXuan"],
        "Hai Duong": ["TpHaiDuong","TpThaiBinh"],
        "Hai Phong": ["HThuyNguyen","QDoSon","QHaiAn","QHongBang","QLeChan","QNgoQuyen"],
        "Hau Giang": ["TpViThanh","TxNgaBay"],
        "Ho Chi Minh City": ["HBinhChanh","HCuChi","HHocMon","HNhaBe","PCatLai","PHiepBinh","PThongTayHoi","Q1","Q2","Q3","Q4","Q5","Q6","Q7","Q8","Q9","Q10","Q11","Q12","QTanBinh","QTanPhu","QThuDuc","XTanVinhLoc","QBinhTan","QBinhThanh","QGoVap","QPhuNhuan","TPhu"],
        "Hung Yen": ["HVanGiang","TpHungYen"],
        "Khanh Hoa": ["TpNhaTrang"],
        "Kien Giang": ["HAnBien","TpRachGia"],
        "Lam Dong": ["HDucTrong","HLamHa","TpBaoLoc","TpDaLat"],
        "Long An": ["HBenLuc","HCanGiuoc","HChauThanh","HDucHoa","TpTanAn"],
        "Nghe An": ["TpVinh"],
        "Quang Nam": ["TpHoiAn","TpTamKy"],
        "Quang Ngai": ["TpQuangNgai"],
        "Soc Trang": ["TpSocTrang"],
        "Tay Ninh": ["HHoaThanh","TpTayNinh","TpTNinh"],
        "Thai Binh": ["HThaiThuy","TpThaiBinh"],
        "Thanh Hoa": ["TpThanhHoa"],
        "Thua Thien Hue": ["TpHue"],
        "Tien Giang": ["HChoGao","TpMyTho","TxCaiLay","TxGoCong"],
        "Tra Vinh": ["HCangLong","HTieuCan"],
        "Vinh Long": ["TpVinhLong"],
        "Vinh Phuc": ["TpVinhYen"]
    }

    return (
        <div>
            <h2>Dashboard Overview</h2>
            <div className="card">
                <h3>Store Locations</h3>
                <div>
                    {loading && <p>Loading map data...</p>}
                    {error && <p style={{ color: 'red' }}>{error}</p>}
                    {!loading && !error && <StoresMap 
                                                stores={stores} 
                                                districts={districts} 
                                                districtMap={districtMap} 
                                            />
                    }
                </div>
            </div>
        </div>
    );
}

export default DashBoardPage;
